import "./App.css";

import AddItem from './Components/Items/ListItem'
import ListItem from "./Components/Items/ListItem";

const Dummy_List=[  
{
    id: 1,
    title: "Finish ACP Project",
  },
];

const addItemHandler = (Item) => {
  setEnteredItem((prevItems) => {
    return [...prevItems, Item];
  });
};

const  App=() =>{
  const [enteredItem, setEnteredItem] = useState(Dummy_List);

  return (
    <div className="App">
      <AddItem onAddItems={addItemHandler}/> 
      <ListItem items={enteredItem} />
    </div>
  );
}

export default App;
